#include <TFT_eSPI.h>

TFT_eSPI tft;

void setup() {
  pinMode(TFT_BL, OUTPUT);
  digitalWrite(TFT_BL, HIGH);   //swtich backlight on Important !!!
  tft.init();
  tft.setRotation(1);
  tft.fillScreen(TFT_BLACK);
  tft.drawString("Hello ESP32", 40, 110, 4);
}

void loop() {}

